var tipuesearch = {"pages":[{"tags":"misc","text":"2016Fall 修課成員網誌","url":"./pages/about/","title":"About"},{"tags":"seat table","text":"倉儲協同 1.+法運算 2.+法運算 3.*法運算 4./法運算 1.+法運算 +法程式碼(add.py) def add (a,b): //def用於定義函式和類型的方法 return a+b //將a+b值傳回主程式中 +法程式碼(print.py) import sys //插入sys檔案中所有函式 sys.path.append(\"./m1\")//資料夾路徑 import add //導入 add.py sum = add.add (1,2) //乘法演算 print(sum) //輸出結果 2.-法運算 -法程式碼(add.py) def add (a,b): //def用於定義函式和類型的方法 return a-b //將a-b值傳回主程式中 -法程式碼(print.py) import sys //插入sys檔案中所有函式 sys.path.append(\"./m1\") //資料夾路徑 import add //導入 add.py sum = add.add (1,2) //乘法演算 print(sum) //輸出結果 3.*法運算 乘法程式碼(add.py) def add (a,b): //def用於定義函式和類型的方法 return a* b //將a乘b值傳回主程式中 乘法程式碼(print.py) import sys //插入sys檔案中所有函式 sys.path.append(\"./m1\") //資料夾路徑 import add //導入 add.py sum = add.add (1,2) //乘法演算 print(sum) //輸出結果 4./法運算 /法程式碼(add.py) def add (a,b): //def用於定義函式和類型的方法 return a/b //將a/b值傳回主程式中 /法程式碼(print.py) import sys//插入sys檔案中所有函式 sys.path.append(\"./m1\") //資料夾路徑 import add//導入 add.py sum = add.add (1,2) // /法演算 print(sum) //輸出結果","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-shi-zhou-zuo-ye.html","title":"協同產品設計實習 第十週作業"},{"tags":"seat table","text":"期中作業 1.Fossil Server 實習查驗 2.四連桿機構協同 Trace Point 查驗 3.Fourbar Walker OnShape 零件協同繪圖與組立查驗 4.分組協同零件展示 1.Fossil Server 實習查驗 ag7期中考報告 fossil 2.Fourbar Walker OnShape 零件協同繪圖與組立查驗 利用OnShape畫Fourbar Walker製作影片 OnShape零件繪製-1 國立虎尾科技大學 機械設計系 協同產品設計實習 40423143 楊智勝 ONSHAPE期中四連桿零件繪製 from 楊智勝 on Vimeo . OnShape零件繪製-2 國立虎尾科技大學 機械設計系 協同產品設計實習 40423143 楊智勝 ONSHAPE期中四連桿 from 楊智勝 on Vimeo . 4.分組協同零件展示 分組協同零件展示 window.onload = function(){ var madeleine = new Madeleine({ target: 'target', // target div id data: './../data/Fourbar1.stl', // data path path: './../work/madeleine/src/' // path to source directory from current html file }); }; select stl file: or drop stl file","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-jiu-zhou-zuo-ye.html","title":"協同產品設計實習 第九週作業"},{"tags":"seat table","text":"期中自評跟總結影片和心得 第八週 期中自評 自評80分 第七週 補齊上週的ONSHAPE八連桿組裝 第六週 ONSHAPE八連桿零件-1 ONSHAPE八連桿零件-2 第六週ONSHAPE零件操作 ONSHAPE零件組合 V-REP 國立虎尾科技大學 機械設計工程系 協同產品設計實習 40423143 v-rep 4link 第一段 from 楊智勝 on Vimeo . 第五週 1.為各班各組在 https://mde2a2.kmol.info 主機上建立 cdbg1(完成後可直接連結至 cdbg1 倉儲, 交由組長管理) ~ cdbg8, 以及 cdag1 ~ cdag8 等線上 Fossil SCM 倉儲, 用來管理各組協同產品設計實習過程中的純文件檔案 2.單連桿製作及導入v-rep 導入v-rep 零件繪製 第四週 第七組FOSSIL SCM連結 https://mde2a2.kmol.info/cdag7/home 第三週翻譯英文影片 第二週影片 4連桿 40423143-4連桿 from 楊智勝 on Vimeo . solvespace零件一 solvespace零件二 solvespace零件三 第一週上課筆記 1.利用solvespace及onshape組裝四連桿機構 2.ipv4和ipv6設定 3.分組方式,如何更有效的決定 4.小組組織跟分工的重要性 5.要主動教導不會的同學 6.ipcofig設定 更改stunnel設定檔ip位址 上課心得:第一週上課,分組應要有更有效率的辦法,小組要多溝通分工,雖然組員都不是很會但相信第二組是可以的 零件一 零件二 零件三 組裝影片 組合圖 修課心得:這半學期除了自己畫了這些零件外,還教會組員如何推資料跟畫零件,每天都應該要排進度,然後接受新的挑戰跟難關,可能還沒辦法做到最好,但至少我們正在努力","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-ba-zhou-zuo-ye.html","title":"協同產品設計實習 第八週作業"},{"tags":"seat table","text":"上課筆記 第七週任務 補齊前面缺的東西 ONSHAPE八連桿零件-1 ONSHAPE八連桿零件-2 ONSHAPE八連桿組裝 心得:上課要認真","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-qi-zhou-zuo-ye.html","title":"協同產品設計實習 第七週作業"},{"tags":"seat table","text":"ONSHAPE四連桿零件操作影片和零件組合 第六週ONSHAPE零件操作 ONSHAPE零件組合 V-REP 國立虎尾科技大學 機械設計工程系 協同產品設計實習 40423143 v-rep 4link 第一段 from 楊智勝 on Vimeo . 心得:過程還算順利 ONSHAPE八連桿零件-1 ONSHAPE八連桿零件-2 GITHUB除錯,身為組長排除萬難都要更新成功 心得:頗有成就感","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-liu-zhou-zuo-ye.html","title":"協同產品設計實習 第六週作業"},{"tags":"seat table","text":"把零件導入v-rep操作影片 第五週 1.為各班各組在 https://mde2a2.kmol.info 主機上建立 cdbg1(完成後可直接連結至 cdbg1 倉儲, 交由組長管理) ~ cdbg8, 以及 cdag1 ~ cdag8 等線上 Fossil SCM 倉儲, 用來管理各組協同產品設計實習過程中的純文件檔案 2.單連桿製作及導入v-rep 導入v-rep 上課心得:入v-rep零件還算輕鬆 零件繪製","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-wu-zhou-zuo-ye.html","title":"協同產品設計實習 第五週作業"},{"tags":"seat table","text":"FOSSIL SCM連結跟概述 第四週 第七組FOSSIL SCM連結 https://mde2a2.kmol.info/cdag7/home Fossil SCM 是一套軟體配置管理 (Software Configuration Management) 系統, 其中包含分散式版次控管 (DVC, Distributed Version Control) 、Wiki 、Bug Tracking 與 Technote 等功能, 可以用來控制及追蹤軟體開發專案, 並且紀錄專案開發歷程, 在協同產品設計實習課程中, 我們除了使用 git、github 與 bitbucket 之外, 將要在區域網路與系上主幹中, 配置每班兩台的 Fossil SCM 實習主機. 上課心得:新架構,新體驗 當組長要幫助不會的同學,還要分配工作,讓我學到更多東西例如:要多溝通,和多了解程式的意思","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-si-zhou-zuo-ye.html","title":"協同產品設計實習 第四週作業"},{"tags":"seat table","text":"翻譯影片 第三週影片 影片二: 內容: The 2017 HyperWorks release has a lot 在2017年HyperWorks發行很多版本 of enhancements to the modeling and assembly capabilities 對軟件的建模和組裝能力的增強 So we put in a new parts browser with a built-in part library 所以我們在一個新的零件瀏覽器與一個內置零件庫 The part library is a great tool for storing and loading work in progress 零件庫是用於存儲和加載正在進行工作的一個很好的工具 So you can store a catalog of all the common parts 因此，您可以存儲所有公共部分的目錄 that a workgroup needs to use,so they can download their models from their PLM system 工作組需要使用，因此他們可以從他們的PLM系統下載他們的模型 and store them locally in a parts library for a work in progress 並將它們本地存儲在正在進行的工作的零件庫中 And it keeps revision control on them, 他保持對它們的修訂控制 so they can back up to the different versions and reload. 所以他們可以備份到不同的版本並重新加載。 And they can also build different configurations now of their models. 他們也可以建立不同的配置到他們現在的的模型。 In the configuration modeler now 現在在配置建模器 they can import parts from part library and then group 他們可以從零件庫導入零件然後分組 them into what we call part sets,which are 他們變成我們所說的部分集 convenient groupings of parts. 即零件方便分組 And then they can drag those parts together into assemblies, 然後他們可以將這些部分一起拖入組件 and configure them for different load 並為不同負載配置它們的 cases or different variations of their models. 情況或他們的模型的不同變化 the other feature of haveing parts in the software 硬件部分的軟件中的另一個特點 is we do part instancing now,too. 我們現在也做實例化 So if you load in a part that has 所以如果你加載在一個部分 multiple instances through the model,we support that. 我們支持多個實例通過模型 We don't have to create multiple copies of it. 我們不必創建它的多個副本 We can actually do the instancing,which is very memory efficient. 我們可以做實際，這是非常有效的記憶。 Also in the model building assembly 也在模型建築組裝 tool set is enhanced ID management as well. 工具集也是增強的ID管理 So not only can we assign IDs based on different rules 因此，我們不僅可以根據不同的規則分配ID that you define in the software,but you can import ID systems 您可以在軟件中定義，但可以導入ID系統 form spreadsheets,XML files,databases, 形式電子表格，XML文件，數據庫， and so forth,that are then used when 等等，然後在使用 it does the renumbering or the assembly of the model. 它進行重新編號或模型的組裝 it has to resolve part collisions. 它必須解決部分碰撞。 Really important part of doing model assembly 做模型組裝重要的部分 is connecting all those parts together. 將所有這些部分連接在一起 Connectors are really vital to the overall assembly process. 連接器對整個裝配過程至關重要。 The quality of the connector that you create really 您真正創建的連接器的質量 determines the outcome of the quality 確定質量的結果 of the overall assembled model as well. 對整體組裝模型 So for us to get a good high fidelity solution, 所以為我們得到一個良好的高保真度解決方案 you have to have a really good connection generation as well. 你必須有一個非常好的連接生成 翻譯心得: 這是由會英文的組員翻的,是有嘗試去聽但聽不是很懂","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-san-zhou-zuo-ye.html","title":"協同產品設計實習 第三週作業"},{"tags":"seat table","text":"solvespace零件 四連桿繪製操作影片 第二週影片 4連桿 40423143-4連桿 from 楊智勝 on Vimeo . solvespace零件一 solvespace零件二 solvespace零件三 心得:solvespace操作要更熟練一點,中間都會小卡住","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-er-zhou-zuo-ye.html","title":"協同產品設計實習 第二週作業"},{"tags":"seat table","text":"座位表和分組名單 設計二甲座位表 seet 40423143 楊智勝是第二組組長 組員有: 40423120 40423123 40423124 40423141 40423146 40423147 40423154 40423114 上課心得:需要更有效率的分組方式","url":"./she-ji-er-jia-zuo-wei-biao.html","title":"設計二甲座位表"},{"tags":"PPT","text":"onshape零件繪製和更改stunnel設定檔ip位址 上課筆記 1.利用solvespace及onshape組裝四連桿機構 2.ipv4和ipv6設定 3.分組方式,如何更有效的決定 4.小組組織跟分工的重要性 5.要主動教導不會的同學 6.ipcofig設定 更改stunnel設定檔ip位址 上課心得:第一週上課,分組應要有更有效率的辦法,小組要多溝通分工,雖然組員都不是很會但相信第二組是可以的 零件一 零件二 零件三 組裝影片 組合圖 組裝心得:算是簡單","url":"./xie-tong-chan-pin-she-ji-shi-xi-di-yi-zhou-zuo-ye.html","title":"協同產品設計實習 第一週作業"}]};